const Customer = () => {
    return (
        <div>
            <Navbar style={{height:"2rem"}} className="bg-light"></Navbar>
            <div className="row">
                <div className="col-md-2 bg-light">
                    <button>Order</button> <br/>
                    <button>Order</button> <br/>
                    <button>Order</button> <br/>



                </div>
                    <div className="col-md-10 bg-dark">
                        
                    </div>
                </div>
        </div>
        
    );
};

export default Customer;
